import React from 'react';
import image1 from './pictures/1.png';
import '../App.css'; // Adjust the path as needed

function AboutUs() {
  return (
    <div className="grid grid-cols-1 gap-4 overflow-y-auto h-screen">
      <div className="container">
        <div className="image-container">
          <img src={image1} alt="Image 1" />
        </div>
        <p className="text">Image 1 Text</p>
      </div>

      <div className="container">
        <div className="image-container">
          <img src="your-image2.jpg" alt="Image 2" />
        </div>
        <p className="text">Image 2 Text</p>
      </div>

      <div className="container">
        <div className="image-container">
          <img src="your-image3.jpg" alt="Image 3" />
        </div>
        <p className="text">Image 3 Text</p>
      </div>
      {/* Add more divs as needed */}
    </div>
  );
}

export default AboutUs;
